import React from 'react'
import { animate, motion } from 'framer-motion'

const parentVariants = {
    hidden: {
         y:"-100vw"
    },
    visible:{
        y:"0" ,
        transition: {
            duration: 1.5,
        } 
    }
}

const childVariant = {
    hidden: {
         y:"-100vw"
    },
    visible:{
        y:"0" ,
        transition: {
            delay:4.5,
            duration: 1.5,
        } 
    }
}

function RightSide() {
  return (
    <motion.div className='w-1/2  bg-gradient-to-b from-blue-950 to to-blue-400'
        variants={parentVariants}
        initial ="hidden"
        animate = "visible"
    >
        <motion.div className='flex flex-col  h-full items-center justify-center'>
            <motion.div className='bg-white/90 w-2/4 h-1/4 rounded-3xl'
                variants={childVariant}
                initial ="hidden"
                animate = "visible"
            >

            </motion.div>


        </motion.div>

    </motion.div>
  )
}

export default RightSide
